import Sidebar from '../Sidebar';
import './index.scss';

const About = () => {
    return (
        <div className='App'>
            <Sidebar />
            <div className='page'>
                <div className='main'>
                    Hi! My name is Erin and I'm a 21 year old college student in the Computer Science Major at the University of North Carolina at Greensboro. <br />
                </div>
            </div>
        </div>
    )
}

export default About;
